import signInBg from "../../img/sign-in-bg.svg";

const SingIn = () => {
  return (
    <div className="container">
      <div className="loginWrapper"></div>
      <div className="loginBg">
        <img src={signInBg} alt="" />
      </div>
    </div>
  );
};

export default SingIn;
